// frontend/src/components/MainPage/index.js
import React from 'react';
import { NavLink } from 'react-router-dom'; //NavLink,
// import { useSelector } from 'react-redux';
import './mainpage.css';
import splash from './images/splash-page-img.jpg';
function MainPage(){

    return(
      <>
        <div className="mainpage">
        <div className="splash">
            <img src={splash} alt="splash1"/>

          <div className="title">
            <h1>The Greatest Outdoors </h1>
            <h3>Wishlists curated by Airbnb.</h3>
          </div>

          <NavLink classto="/listings">
              <button> Explore The World!</button>
          </NavLink>
          </div>
        </div>
      </>
    )
  }
  export default MainPage;
